     @org.junit.Test
     public void testOK(){
         OkHttpClient client = new OkHttpClient().newBuilder()
                 .build();
         MediaType mediaType = MediaType.parse("application/x-www-form-urlencoded");
         RequestBody body = RequestBody.create(mediaType, "businessId=a6b241699db511ebb35d6c92bfcb85b0&dataId=20190723000071481&articleId=1234567890&");
         Request request = new Request.Builder()
                 .url("http://10.101.23.132:8080/v1/gateway/picture/quality")
                 .method("POST", body)
                 .addHeader("Content-Type", "application/x-www-form-urlencoded")
                 .build();
         try {
             Response response = client.newCall(request).execute();
             ResponseBody body1 = response.body();
             System.out.println(body1.string());
         } catch (IOException e) {
             e.printStackTrace();
         }
     }

